import './App.css';
import {connect} from 'react-redux'
import { submit } from './redux/actions'

function App (props) {
  console.log(props.transaction);
  console.log(props.list)
  return (
    <div className="App">
      <header className="App-header">
        <div>
          <input type='text' id='1' placeholder='blabla'></input>
          <input type='text' id='2' placeholder='blabla'></input>
          <input type='text' id='3' placeholder='blabla'></input>
          <input type='text' id='4' placeholder='blabla'></input>
          <button onClick={()=>{props.submit(
            {
              1:document.querySelector('#1').value,
              2:document.querySelector('#2').value, 
              3:document.querySelector('#3').value,
              4:document.querySelector('#4').value})}}>submit</button>
        </div>
        <div>

        </div>
      </header>
    </div>
  );
}

const mapStateToProps = (state) => {
  return {
      transaction: state.transaction,
      list:state.transactionList
  }
}

const mapDispatchToProps = (dispatch)=> {
  return {
      submit: (obj) => dispatch(submit(obj))
  }
}

export default connect(mapStateToProps, mapDispatchToProps)(App)
